import React from "react";
import { Link } from "react-router-dom";

const Card = ({ name, username, id, addToFavorites }) => {
  return (
    <div className="card">
      <h3>{name}</h3>
      <p>@{username}</p>
      <Link to={`/dentist/${id}`}>See Details</Link>
      <button onClick={() => addToFavorites(id)} className="favButton">Add Fav</button>
    </div>
  );
};

export default Card;
